import React from 'react';
import styles from './styles.module.scss';
import { Spinner } from 'reactstrap';

const Loader = () => {
  return (
    <div className={styles.loaderWrapper}>
      <Spinner style={{ width: '2rem', height: '2rem' }} />
    </div>
  );
};

export default Loader;
